import Link from 'next/Link';

const Index = ()=> {
    return (
    <div>
        <ul>
            <li>
         <Link href="/"><Button>Home</Button></Link>
         </li>
         <li>
     <Link href="/aboutSpaceX"><Button>About SpaceX Programs</Button></Link>
     </li>
     </ul>
       <h1>Welcome to Space X Programs </h1> 
        </div>
    );
}
export default Index;
